import React from 'react'
import classes from './ResetRound.module.css'
import {useSelector, useDispatch} from "react-redux";
import {
	defaultTimerSetting,
	resetRound
} from '../../utilites/timerSettings';

const ResetRound = () => {
  const dispatch=useDispatch()
  const status= useSelector((state) => state.status.littlePause);
  return (
    <div className={classes.skip_wrapper}>
    {status ? (
      <span onClick={()=>{ dispatch(resetRound())}}>
        Обновить раунд
      </span>
    ) : (
      <span>
        Пропустить паузу
      </span>
    )}
  </div>
  )
}

export default ResetRound
